import React from "react";
import { useNavigate } from "react-router-dom";

function Openview() {

    const router = useNavigate()
      useEffect(() => {
        window.scrollTo(0, 0);
        window.history.scrollRestoration = 'manual';
      }, []);

    
  return (
    <section>
      <div className="container-fluid p-0">
        <div className="position-relative">
          <div className="open-video">
            <video
              src="\video\8089117-uhd_4096_2160_25fps.mp4"
              autoPlay
              muted
              loop
            />
          </div>
          <div className="brnd-round position-absolute text-center">
            <img src="\assets\brand_logo.jpg" className="img-fluid"/>
          </div>
            <div className="open-btn position-absolute">
                <div className="container">
                    <div className="row">
                        <div className="col-6">
                            <div className="clk-txt text-center">
                                <h2 onClick={()=>{router('/portfolio')}}>Portfolio</h2>
                            </div>
                        </div>
                        <div className="col-6">
                        <div className="clk-txt text-center">
                                <h2 onClick={()=>{router('/about')}}>Our Mission</h2>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
      </div>
    </section>
  );
}

export default Openview;
